import { useContext } from "react";
import { styled } from "@mui/material/styles";
import {
	Table,
	TableHead,
	TableRow,
	TableCell,
	TableBody,
	Typography,
	Button,
} from "@mui/material";

import UserRows from "../components/UserRows";
import { HEADERS } from "../utils/constants";
import { FilterContext } from "../context/FilterContext";

const BootstrapButton = styled(Button)({
	boxShadow: "none",
	textTransform: "none",
	fontSize: 16,
	padding: "6px 12px",
	border: "1px solid",
	lineHeight: 1.5,
	backgroundColor: "#0063cc",
	borderColor: "#0063cc",
	fontFamily: [
		"-apple-system",
		"BlinkMacSystemFont",
		'"Segoe UI"',
		"Roboto",
		'"Helvetica Neue"',
		"Arial",
		"sans-serif",
		'"Apple Color Emoji"',
		'"Segoe UI Emoji"',
		'"Segoe UI Symbol"',
	].join(","),
	"&:hover": {
		backgroundColor: "#0069d9",
		borderColor: "#0062cc",
		boxShadow: "none",
	},
	"&:active": {
		boxShadow: "none",
		backgroundColor: "#0062cc",
		borderColor: "#005cbf",
	},
	"&:focus": {
		boxShadow: "0 0 0 0.2rem rgba(0,123,255,.5)",
	},
});

const UserTable = () => {
	const { result, filteredData, handleExportFile } = useContext(FilterContext);
	let Rows = [];

	if (filteredData.length > 0) {
		filteredData.forEach((user, index) => {
			Rows.push(<UserRows user={user} key={index} />);
		});
	} else {
		result.forEach((user, index) => {
			Rows.push(<UserRows user={user} key={index} />);
		});
	}

	return (
		<Table stickyHeader aria-label="sticky table">
			<TableHead>
				<TableRow>
					<TableCell colSpan={5}>
						<Typography variant="subtitle1" align="center">
							77 - Jamnagar Rular
						</Typography>
					</TableCell>
					<TableCell colSpan={3}>
						<Button
							variant="contained"
							size="small"
							onClick={handleExportFile}
							style={{ fontSize: "13px" }}
						>
							Export to Excel
						</Button>
					</TableCell>
				</TableRow>
				<TableRow>
					{HEADERS &&
						HEADERS.map((item) => {
							return (
								<TableCell key={item} style={{ top: 45 }}>
									{item}
								</TableCell>
							);
						})}
				</TableRow>
			</TableHead>
			<TableBody>{Rows}</TableBody>
		</Table>
	);
};

export default UserTable;
